using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using Rnd = UnityEngine.Random;

namespace PatternCube
{
    sealed class FaceSymbol : IEquatable<FaceSymbol>
    {
        public char Symbol { get; private set; }
        public int Orientation { get; private set; }
        public bool Equals(FaceSymbol other) { return other != null && other.Symbol == Symbol && other.Orientation == Orientation; }
        public FaceSymbol(char symbol, int orientation) { Symbol = symbol; Orientation = orientation; }
    }
    sealed class HalfCube
    {
        public FaceSymbol Top { get; private set; }
        public FaceSymbol Left { get; private set; }
        public FaceSymbol Front { get; private set; }
        public HalfCube(FaceSymbol top, FaceSymbol left, FaceSymbol front) { Top = top; Left = left; Front = front; }

        public static HalfCube Random(char[] combination, Random rnd)
        {
            return new HalfCube(new FaceSymbol(combination[0], rnd.Next(0, 4)), new FaceSymbol(combination[1], rnd.Next(0, 4)), new FaceSymbol(combination[2], rnd.Next(0, 4)));
        }
    }
    sealed class FaceInfo : IEquatable<FaceInfo>
    {
        public int Face { get; private set; }
        public int Orientation { get; private set; }
        public bool Equals(FaceInfo other) { return other != null && other.Face == Face && other.Orientation == Orientation; }
        public FaceInfo(int face, int orientation) { Face = face; Orientation = orientation; }
    }
    sealed class Net : IEquatable<Net>
    {
        public FaceInfo[,] Faces { get; private set; }
        public Net(FaceInfo[,] faces) { Faces = faces; }
        public bool Equals(Net other)
        {
            if (other == null)
                return false;
            if ((Faces == null) != (other.Faces == null))
                return false;
            if (Faces == null)
                return true;
            if (other.Faces.GetLength(0) != Faces.GetLength(0) || other.Faces.GetLength(1) != Faces.GetLength(1))
                return false;

            for (int i = Faces.GetLength(0) - 1; i >= 0; i--)
                for (int j = other.Faces.GetLength(1) - 1; j >= 0; j--)
                    if (!Equals(Faces[i, j], other.Faces[i, j]))
                        return false;
            return true;
        }
        public string ID
        {
            get
            {
                return string.Join("-",
                    Enumerable.Range(0, Faces.GetLength(1)).Select(y =>
                        string.Join("",
                            Enumerable.Range(0, Faces.GetLength(0)).Select(x => Faces[x, y] == null ? "_" : "X").ToArray())).ToArray());
            }
        }

        public static Net Parse(int w, int h, string[] data)
        {
            var arr = new FaceInfo[w, h];
            for (int y = 0; y < h; y++)
            {
                var s = data[y].Split('/');
                for (int x = 0; x < w; x++)
                {
                    if (s[x] == "-")
                        continue;
                    var fo = s[x].Split(',');
                    arr[x, y] = new FaceInfo(int.Parse(fo[0]), int.Parse(fo[1]));
                }
            }
            return new Net(arr);
        }
    }

